import React from 'react';
import CourseEnrollmentButton from './CourseEnrollmentButton';

function CourseEnrollmentPage() {
  return (
    <div>
      <h2>Course Catalog</h2>
      {/* List of courses */}
      <CourseEnrollmentButton />
    </div>
  );
}

export default CourseEnrollmentPage;
